(self.webpackChunk_okp4_docs=self.webpackChunk_okp4_docs||[]).push([[15695],{81237:function(e,t,a){"use strict";a.r(t),a.d(t,{assets:function(){return d},contentTitle:function(){return l},default:function(){return u},frontMatter:function(){return r},metadata:function(){return c},toc:function(){return p}});var n=a(87462),i=a(63366),s=(a(67294),a(3905)),o=(a(29420),["components"]),r={sidebar_position:2},l="Introduction",c={unversionedId:"whitepaper/introduction",id:"whitepaper/introduction",title:"Introduction",description:"Motivation",source:"@site/docs/whitepaper/introduction.md",sourceDirName:"whitepaper",slug:"/whitepaper/introduction",permalink:"/whitepaper/introduction",draft:!1,editUrl:"https://github.com/okp4/docs/edit/main/docs/whitepaper/introduction.md",tags:[],version:"current",sidebarPosition:2,frontMatter:{sidebar_position:2},sidebar:"mainSidebar",previous:{title:"Abstract",permalink:"/whitepaper/abstract"},next:{title:"OKP4 Blockchain",permalink:"/whitepaper/okp4-blockchain"}},d={},p=[{value:"Motivation",id:"motivation",level:2},{value:"From Data to Knowledge",id:"from-data-to-knowledge",level:3},{value:"Why we need data sharing",id:"why-we-need-data-sharing",level:3},{value:"Why is data sharing not the norm then?",id:"why-is-data-sharing-not-the-norm-then",level:3},{value:"Existing approaches",id:"existing-approaches",level:2},{value:"Technology is getting more mature by the day",id:"technology-is-getting-more-mature-by-the-day",level:3},{value:"But the perfect technology doesn&#39;t exist, yet",id:"but-the-perfect-technology-doesnt-exist-yet",level:3},{value:"Introducing \u2013 OKP4",id:"introducing--okp4",level:2},{value:"What is OKP4?",id:"what-is-okp4",level:3},{value:"What is a Data Space ?",id:"what-is-a-data-space-",level:3},{value:"What is the Dataverse?",id:"what-is-the-dataverse",level:3},{value:"OKP4 described",id:"okp4-described",level:2},{value:"OKP4 Blockchain",id:"okp4-blockchain",level:3},{value:"Data Spaces",id:"data-spaces",level:3},{value:"Dataverse",id:"dataverse",level:3},{value:"Applications",id:"applications",level:3},{value:"To sum up",id:"to-sum-up",level:3},{value:"Network participants",id:"network-participants",level:2},{value:"Multi-layered governance",id:"multi-layered-governance",level:2}],h={toc:p};function u(e){var t=e.components,r=(0,i.Z)(e,o);return(0,s.kt)("wrapper",(0,n.Z)({},h,r,{components:t,mdxType:"MDXLayout"}),(0,s.kt)("h1",{id:"introduction"},"Introduction"),(0,s.kt)("h2",{id:"motivation"},"Motivation"),(0,s.kt)("p",null,"Digital innovation has tremendously impacted the way we do business, the way we exchange and consume information. Data has become a resource upon which many businesses have been built. It altered our society and everyday life in every possible way."),(0,s.kt)("h3",{id:"from-data-to-knowledge"},"From Data to Knowledge"),(0,s.kt)("p",null,"Data is an objective and elementary description of reality. It has no value by itself. It needs to be processed and interpreted to create valuable information and knowledge. Knowledge is usually subjective and context-dependant."),(0,s.kt)("p",null,(0,s.kt)("img",{alt:"From data to knowledge",src:a(19031).Z,width:"1065",height:"380"})),(0,s.kt)("h3",{id:"why-we-need-data-sharing"},"Why we need data sharing"),(0,s.kt)("p",null,"We don\u2019t ",(0,s.kt)("em",{parentName:"p"},"know")," how to go to Mars, we don\u2019t ",(0,s.kt)("em",{parentName:"p"},"know")," how to predict cancer, we don\u2019t ",(0,s.kt)("em",{parentName:"p"},"know")," how to farm in a desert, and we don\u2019t ",(0,s.kt)("em",{parentName:"p"},"know")," what present would please our mother for her birthday."),(0,s.kt)("p",null,"Knowledge is the limiting factor to common good, for individuals, companies and society at large."),(0,s.kt)("p",null,"In our digitalized world, one of the most efficient way to unlock knowledge is through data."),(0,s.kt)("p",null,"But data is rarely shared. It stays in silos, isolated and protected. As such, data is under-used and under-valued. Indeed, data is a ",(0,s.kt)("a",{parentName:"p",href:"https://en.wikipedia.org/wiki/Rivalry_(economics)"},"non-rival good"),", which means that I can share it many times without changing my ability to use it. Generating knowledge from data is theoretically infinite. That's why an incommensurable amount of value could be unlocked through data sharing."),(0,s.kt)("h3",{id:"why-is-data-sharing-not-the-norm-then"},"Why is data sharing not the norm then?"),(0,s.kt)("p",null,"Today's problem is that individuals and companies are incentivized to build gated data lakes, to keep their users captive and to restrict access to data and information, mostly because of:"),(0,s.kt)("ul",null,(0,s.kt)("li",{parentName:"ul"},"Risk (lack of trust between participants, the fear of loss of competitive advantage)"),(0,s.kt)("li",{parentName:"ul"},"Complexity (interoperability & governance issues)"),(0,s.kt)("li",{parentName:"ul"},"Costs (lack of infrastructures, R&D)"),(0,s.kt)("li",{parentName:"ul"},"Lack of incentives (bad business models, bad incentives, unclear benefits)")),(0,s.kt)("p",null,(0,s.kt)("img",{alt:"Frictionless",src:a(56433).Z,width:"1065",height:"380"})),(0,s.kt)("p",null,(0,s.kt)("strong",{parentName:"p"},"But what if we could enable trust-minimized data sharing and unlock this untapped potential?")),(0,s.kt)("h2",{id:"existing-approaches"},"Existing approaches"),(0,s.kt)("p",null,"Since data is everywhere and knowledge is valuable, the issues related to data sharing and knowledge creation are far from being new concepts for individuals and organizations."),(0,s.kt)("p",null,"Many approaches already exist to share data between entities:"),(0,s.kt)("p",null,(0,s.kt)("img",{alt:"Degree of federation in data-sharing models",src:a(23624).Z,width:"1065",height:"516"})),(0,s.kt)("p",null,"Data exchange is the most common model today, while a decentralized approach to data sharing seems to be the most promizing. In fact, it will enable data sharing without trusted third parties, without moving data from its existing place and even enable decentralized governance on data sharing rules."),(0,s.kt)("p",null,"Game theory applied to governance issues with tokens as tools for interest alignment is a field in which we've just scratched the surface. The future looks bright."),(0,s.kt)("h3",{id:"technology-is-getting-more-mature-by-the-day"},"Technology is getting more mature by the day"),(0,s.kt)("p",null,"Gated data lakes are the norm today\xa0because we lacked the economic incentives to fund, the technology to build, and the organizational structures to manage an open Dataverse."),(0,s.kt)("p",null,"It is changing now."),(0,s.kt)("p",null,"Through technology and governance innovation, public blockchain technology will be the key infrastructure opening the gates of trust-minimized data sharing. Thus providing opportunities to unlock new sources of valuable knowledge that will solve humanity's problems, from small to existencial ones, thanks to the next generation of Applications."),(0,s.kt)("h3",{id:"but-the-perfect-technology-doesnt-exist-yet"},"But the perfect technology doesn't exist, yet"),(0,s.kt)("p",null,"Ethereum initiated a wave of decentralized applications thanks to smart contracts.\nFollowing Ethereum steps, many other ",(0,s.kt)("a",{parentName:"p",href:"https://academy.binance.com/en/articles/what-is-layer-1-in-blockchain"},"layer-1"),' blockchains emerged. Some offering "more scalable versions" through bigger blocksize or higher block frequency, some offering other smart contract programming languages such as ',(0,s.kt)("a",{parentName:"p",href:"https://docs.solana.com/developing/on-chain-programs/developing-rust"},"Rust")," or ",(0,s.kt)("a",{parentName:"p",href:"https://agoric.com/documentation/guides/js-programming/"},"Javascript"),", some offering privacy-preserving technologies such as ",(0,s.kt)("a",{parentName:"p",href:"https://z.cash/technology/zksnarks/"},"zk-SNARKs"),"."),(0,s.kt)("p",null,"Then, which infrastructure should we choose to build applications based on trust-minimized data sharing?"),(0,s.kt)("p",null,"By asking ourselves this question, we quickly realized that:"),(0,s.kt)("ul",null,(0,s.kt)("li",{parentName:"ul"},"There is no such applications designed on public blockchains, so no existing network effect to benefit from."),(0,s.kt)("li",{parentName:"ul"},"General-purpose chains are not specifically designed for such complex apps: multiple layers of smart contracts generate increased risks and complexity."),(0,s.kt)("li",{parentName:"ul"},"Developers are restrained by smart contracts programming languages & virtual machines of these blockchains."),(0,s.kt)("li",{parentName:"ul"},"These infrastructures are not designed to enable data network effects.")),(0,s.kt)("p",null,"To sum up, trust-minimized data sharing may need its own layer-1."),(0,s.kt)("h2",{id:"introducing--okp4"},"Introducing \u2013 OKP4"),(0,s.kt)("p",null,"The previously mentioned reasons led us to create OKP4 (Open Knowledge Protocol For... everything and everyone)."),(0,s.kt)("p",null,(0,s.kt)("img",{alt:"OKP4_banner",src:a(64207).Z,width:"1065",height:"287"})),(0,s.kt)("h3",{id:"what-is-okp4"},"What is OKP4?"),(0,s.kt)("p",null,"OKP4 is a public PoS layer 1 blockchain built for trust-minimized data sharing."),(0,s.kt)("p",null,"OKP4 is an open interoperable smart contracts platform for highly customized rules, governance mechanisms and business models to align interests between participants and build useful distributed applications."),(0,s.kt)("p",null,"Anyone can create custom ecosystems called ",(0,s.kt)("a",{parentName:"p",href:"https://gaia-x.eu/what-is-gaia-x/core-elements/data-spaces/"},"Data Spaces"),". In each Data Space, people & companies can share data, algorithms, software, storage and computation according to Data Space's rules."),(0,s.kt)("p",null,"The OKP4 protocol enables developers to build applications based on distributed digital resources shared by participants (datasets, algorithms, storage, computation...). These shared digital resources together constitute the Dataverse, an ever-expanding universe of resources that can interact with each other through custom ecosystems of shared rules."),(0,s.kt)("p",null,"With OKP4, builders can find development kits, governance templates and easy-to-integrate applications to design their own applications and Data Spaces. Participants can provide any off-chain digital asset they want to make it findable, available and interoperable with other digital resources of the ecosystem. This on-chain coordination unlocks revolutionary possibilities to generate applications leveraging data and services from many businesses and individuals without any trusted third party accessing these digital resources. It enables new opportunities to generate value from data without exchanging it with other parties, thus bringing trust and incentives to share it and build new, better applications."),(0,s.kt)("p",null,'OKP4 is designed to become the commons for builders, data providers, communities, businesses, data scientists & users to unlock tangible value creation through a new generation of web3 "real-life" use cases, way beyond Decentralized Finance.'),(0,s.kt)("p",null,"OKP4 is built using the Cosmos SDK and is fundamentally a multichain infrastructure project. Our core value proposition relies on interchain applications leveraging existing networks inside and outside of the Cosmos ecosystem, such as Akash, Juno, Osmosis, Cheqd, Stargaze, Filecoin, Arweave, Ethereum and many more..."),(0,s.kt)("h3",{id:"what-is-a-data-space-"},"What is a Data Space ?"),(0,s.kt)("p",null,(0,s.kt)("img",{alt:"Data Spaces",src:a(40527).Z,width:"1200",height:"675"})),(0,s.kt)("p",null,"A Data Space is a digital common that makes data and services (algorithms, computing resources, etc.) available to the community, based on shared governance, for the creation of knowledge. The governance guarantees the individual and collective interests of the participants, who retain the sovereignty of their resources."),(0,s.kt)("p",null,"A Data Space consists of three elements:"),(0,s.kt)("ol",null,(0,s.kt)("li",{parentName:"ol"},"Bundle of rights & rules that regulates interactions between data and services (algorithms, infrastructure and every other resources shared by participants)"),(0,s.kt)("li",{parentName:"ol"},"Governance mechanisms to make these rules evolve"),(0,s.kt)("li",{parentName:"ol"},"Interfaces to create, modify and interact with the Data Space")),(0,s.kt)("h3",{id:"what-is-the-dataverse"},"What is the Dataverse?"),(0,s.kt)("p",null,"The Dataverse is inspired from the term Metaverse, a growing buzzword that embodies the next generation of internet experiences combining virtual reality and digital ownership. The challenge with the Metaverse is to build it on an open infrastructure, so that users are not captive of the companies and siloed environments produced by companies."),(0,s.kt)("p",null,"The Dataverse is an open world where users become owners. They own their data, the algorithms & resources they provide. They can even own the blockchain infrastructure and can be involved in its governance."),(0,s.kt)("p",null,"The Dataverse is not a datalake or a cloud where data is stored centrally. Everything can stay at the source, that's why Dataverse participants are always sovereign about what they share. The Data Spaces leveraging the Dataverse can be nested and overlapping, as one dataset can participate in many Data Spaces, and many applications can be built on top of one Data Space."),(0,s.kt)("h2",{id:"okp4-described"},"OKP4 described"),(0,s.kt)("p",null,"To sum up, OKP4 is a ",(0,s.kt)("strong",{parentName:"p"},"blockchain")," for anyone to build and join ",(0,s.kt)("strong",{parentName:"p"},"Data Spaces"),", share ",(0,s.kt)("strong",{parentName:"p"},"data & services")," within these Data Spaces, and build and use ",(0,s.kt)("strong",{parentName:"p"},"applications")," which will leverage what has been shared."),(0,s.kt)("p",null,"It is important to understand these 4 key concepts:"),(0,s.kt)("ul",null,(0,s.kt)("li",{parentName:"ul"},(0,s.kt)("strong",{parentName:"li"},"OKP4 Blockchain")," (consensus & execution layer, enabling the coordination of network participants)"),(0,s.kt)("li",{parentName:"ul"},(0,s.kt)("strong",{parentName:"li"},"Data Spaces")," (rights and rules enabling data & services interactions and governance mechanisms to change these rules)"),(0,s.kt)("li",{parentName:"ul"},(0,s.kt)("strong",{parentName:"li"},"OKP4 Dataverse")," comprised of ",(0,s.kt)("strong",{parentName:"li"},"Data & Services")," (off-chain data & services referenced via metadata and APIs; coordinated by the blockchain according to Data Space's rules)"),(0,s.kt)("li",{parentName:"ul"},(0,s.kt)("strong",{parentName:"li"},"Applications")," (off-chain apps leveraging outputs from the distributed network and bringing value for the end-users)")),(0,s.kt)("p",null,"Let's dive into each of these."),(0,s.kt)("h3",{id:"okp4-blockchain"},"OKP4 Blockchain"),(0,s.kt)("p",null,(0,s.kt)("strong",{parentName:"p"},"OKP4 blockchain")," is the decentralized layer that:"),(0,s.kt)("ul",null,(0,s.kt)("li",{parentName:"ul"},"Guarantees trust through decentralization by the Tendermint Consensus & the native token $KNOW"),(0,s.kt)("li",{parentName:"ul"},"Indexes anything as a service (as long as it is accessible via an API) - any off-chain dataset, algorithm, software, storage or computation resource and even on-chain services from other IBC-enabled networks"),(0,s.kt)("li",{parentName:"ul"},"Exposes metadata of indexed data and services to make it findable, accessible and interoperable"),(0,s.kt)("li",{parentName:"ul"},"Defines Data Spaces rules in ",(0,s.kt)("a",{parentName:"li",href:"https://en.wikipedia.org/wiki/Prolog"},"Prolog")),(0,s.kt)("li",{parentName:"ul"},"Is an open smart contracts platform powered by ",(0,s.kt)("a",{parentName:"li",href:"http://cosmwasm.com"},"CosmWasm")," for maximum governance customization."),(0,s.kt)("li",{parentName:"ul"},"Orchestrates off-chain data & services and initiates workflows which power applications"),(0,s.kt)("li",{parentName:"ul"},"Enforces governance rules, including access rights and value transfers"),(0,s.kt)("li",{parentName:"ul"},"Connects seamlessly to other blockchain networks using ",(0,s.kt)("a",{parentName:"li",href:"https://ibcprotocol.org/"},"IBC"))),(0,s.kt)("p",null,"It is the single source of truth that is used to build autonomous and distributed applications."),(0,s.kt)("h3",{id:"data-spaces"},"Data Spaces"),(0,s.kt)("p",null,(0,s.kt)("strong",{parentName:"p"},"Data Spaces")," are sets of rules and governance mechanisms set in smart contracts, designed to optimize data and services sharing within a community. It is not a common database but an abstraction that defines the interaction between datasets and services, from access rights and business models. Providers share digital resources within a Data Space, according to specific conditions explicitly mentionned. They can share their data in multiple Data Spaces. Each Data Space can have its own customizable governance mechanisms, from multi-sig to a custom Data Space token. The OKP4 Blockchain can host an endless number of Data Spaces."),(0,s.kt)("h3",{id:"dataverse"},"Dataverse"),(0,s.kt)("p",null,"The Dataverse is comprised of datasets and services that are shared by sovereign network participants - they don't have to copy the digital resource somewhere else to make it available."),(0,s.kt)("p",null,(0,s.kt)("strong",{parentName:"p"},"Datasets")," are bytes of information stored on a server (any data storage is possible, either decentralized like ",(0,s.kt)("a",{parentName:"p",href:"https://ipfs.io"},"IPFS")," or ",(0,s.kt)("a",{parentName:"p",href:"https://www.arweave.org/"},"Arweave"),", or centralized like ",(0,s.kt)("a",{parentName:"p",href:"https://aws.amazon.com/"},"AWS")," or ",(0,s.kt)("a",{parentName:"p",href:"https://azure.microsoft.com/"},"Azure"),"), indexed on the Blockchain and accessible through a dedicated gateway."),(0,s.kt)("p",null,(0,s.kt)("strong",{parentName:"p"},"Services")," are algorithms, software, computation, storage, or any digital asset accessible through an API. This comprises algorithms such as data processing services, automatic description of datasets, knowledge graph query services, etc."),(0,s.kt)("p",null,"We designed OKP4 to enable maximum customization. Anyone can share any kind of data, algorithms, software, storage and computation into the Dataverse, you can even implement any standard or DID provider. OKP4 Dataverse enables XaaS (anything as a service) by design."),(0,s.kt)("h3",{id:"applications"},"Applications"),(0,s.kt)("p",null,(0,s.kt)("strong",{parentName:"p"},"Applications")," are built on top of Data Spaces and their inherent rules. They use the data-products (outputs from OKP4) as inputs in applications that provides information, knowledge, initializes actions, etc. Applications are not considered as resources in the Dataverse but final consumers. However, they appear in the protocol to be allowed to access the data."),(0,s.kt)("p",null,"Applications can have their own governance mechanisms. For example, private companies may use outputs from a decentralized Data Space to build their own applications."),(0,s.kt)("h3",{id:"to-sum-up"},"To sum up"),(0,s.kt)("p",null,"Datasets and services provide the elementary building blocks that will interact in a distributed fashion according to the workflows initiated in the Blockchain.\nEach workflow initiated in the blockchain refers to one specific Data Space with its own explicit rules.\nEach dataset and service interacts within to one or many Data Spaces according to the access given by the data and service providers.\nThe outputs of the distributed workflows are leveraged by Applications to provide value to the end users."),(0,s.kt)("p",null,"Anyone can create or customize Data Spaces and Applications using ",(0,s.kt)("strong",{parentName:"p"},"OKP4 Development Kit"),". It allows anyone to build and design with as much freedom as possible, as simply as possible. Developers, data scientists and communities at large can:"),(0,s.kt)("ul",null,(0,s.kt)("li",{parentName:"ul"},"Customize Data Space governance with no-code tools & templates"),(0,s.kt)("li",{parentName:"ul"},"Easily build applications from software to interfaces"),(0,s.kt)("li",{parentName:"ul"},"Use or provide digital resources in the Dataverse")),(0,s.kt)("h2",{id:"network-participants"},"Network participants"),(0,s.kt)("p",null,"On the ",(0,s.kt)("strong",{parentName:"p"},"Blockchain layer"),", there are ",(0,s.kt)("a",{parentName:"p",href:"/whitepaper/roles#validators"},"Validators"),", ",(0,s.kt)("a",{parentName:"p",href:"/whitepaper/roles#delegators"},"Delegators")," and ",(0,s.kt)("a",{parentName:"p",href:"/whitepaper/roles#dao-participants"},"DAO Participants"),"."),(0,s.kt)("p",null,"On the ",(0,s.kt)("strong",{parentName:"p"},"Data Space layer"),", there are ",(0,s.kt)("a",{parentName:"p",href:"/whitepaper/roles#data-providers"},"Data & Service Providers")," who agree to share based on Data Space's rules and ",(0,s.kt)("a",{parentName:"p",href:"/whitepaper/roles#data-providers"},"Consumers")," who pay tokens to initiate workflows in order to create knowledge. There are also ",(0,s.kt)("a",{parentName:"p",href:"/whitepaper/roles#curators"},"Curators")," who can signal promising data/services and ",(0,s.kt)("a",{parentName:"p",href:"/whitepaper/roles#curators"},"Governors")," who can change these rules."),(0,s.kt)("p",null,"On the ",(0,s.kt)("strong",{parentName:"p"},"Application layer"),", there are ",(0,s.kt)("a",{parentName:"p",href:"/whitepaper/roles#builders"},"Builders")," who develop and maintain applications, and also end-users who benefit from knowledge created through the whole OKP4 Ecosystem. End-users can be directly Consumers, or just a user of the Application."),(0,s.kt)("h2",{id:"multi-layered-governance"},"Multi-layered governance"),(0,s.kt)("p",null,(0,s.kt)("img",{alt:"combine_web2_web3",src:a(51027).Z,width:"1065",height:"287"})),(0,s.kt)("p",null,"The main criticisms we can address at web2 companies and especially tech giants are their extractive nature, their willingness to keep users captive on their platforms, and their increasing power controlled by centralized governance."),(0,s.kt)("p",null,"But web3 also has its own sets of problems; pretty wild and self-reliant, UX is bad, allocation of capital can be messy and coordination is often suboptimal."),(0,s.kt)("p",null,"To build the best data sharing infrastructure, we need to enable the best of both web2 and web3 worlds through multi-layered governance:"),(0,s.kt)("ul",null,(0,s.kt)("li",{parentName:"ul"},(0,s.kt)("strong",{parentName:"li"},"OKP4 Blockchain")," is decentralized by design, with its set of token holders that propose and vote on governance proposals - it's a trustless and censorship-resistant infrastructure."),(0,s.kt)("li",{parentName:"ul"},(0,s.kt)("strong",{parentName:"li"},"Data Spaces")," have custom governance. Data Space governance can be centralized (one or few accounts have the ability to design rules through monosig or multisig) or decentralized (through token-based voting power)")),(0,s.kt)("p",null,"This design can be ideal for some companies who want to have control over the Data Space rules, while leveraging the decentralized infrastructure that guarantees data & services providers complete ownership over what they shared. They can remove their consents at any time and can verify that the system acted accordingly to the rules they agreed on."),(0,s.kt)("ul",null,(0,s.kt)("li",{parentName:"ul"},(0,s.kt)("strong",{parentName:"li"},"Applications")," also have custom governance. It can be as simple as a centralized front-end to consume workflow outputs, or more decentralized through community-run applications using only decentralized storage and computation resources."),(0,s.kt)("li",{parentName:"ul"},(0,s.kt)("strong",{parentName:"li"},"Datasets & services")," are sovereign to the data and services providers. Providers (individuals or companies) can define general permissions/requirements for their digital resources to be used in many Data Spaces, but also can hand-pick the Data Spaces (and align themselves with the Data Space's rules) in which they want to contribute.")),(0,s.kt)("p",null,"This mixture of governance layers enables the Dataverse to combine strengths from web2 and web3 worlds: where centralized governance models can be built on top of an open decentralized infrastructure, enabling interoperability and sovereignty by design."))}u.isMDXComponent=!0},11748:function(e,t,a){var n={"./locale":89234,"./locale.js":89234};function i(e){var t=s(e);return a(t)}function s(e){if(!a.o(n,e)){var t=new Error("Cannot find module '"+e+"'");throw t.code="MODULE_NOT_FOUND",t}return n[e]}i.keys=function(){return Object.keys(n)},i.resolve=s,e.exports=i,i.id=11748},64207:function(e,t,a){"use strict";t.Z=a.p+"assets/images/banner_okp4-b8ef973c2443ad08e833f0e4b1d7e753.webp"},19031:function(e,t){"use strict";t.Z="data:image/webp;base64,"},40527:function(e,t,a){"use strict";t.Z=a.p+"assets/images/Illustration_dataspace-702278f5dbdc80d3d851bae274232b1c.webp"},51027:function(e,t,a){"use strict";t.Z=a.p+"assets/images/combine_web2_web3-f5c0967dedb79bd04c37a49c2ae56dc2.webp"},23624:function(e,t,a){"use strict";t.Z=a.p+"assets/images/degree_of_federation-5c85b73f65244c6bc2dc4d73f6963b8b.webp"},56433:function(e,t,a){"use strict";t.Z=a.p+"assets/images/frictionless-6202bcb191b088b524542a945bbb0490.webp"}}]);